pragma solidity ^0.8.8;

//para utilizar los nodos de chainlink (son descentralizados) que calculan el precio 



/*
    WHAT IS AN INTERFACE?
    An interface allows you to talk to another contract on the blockchain. As you can see, to define an interface, 
    you start out like a regular contract, with the contract keyword. Inside this contract, you only define the functions you want to interact with, without their bodies.
    An interface allows you to talk to another contract on the blockchain. As you can see, to define an interface, you start out like a regular contract, 
    with the contract keyword. Inside this contract, you only define the functions you want to interact with, without their bodies.
*/

import "./PriceConverter.sol";

contract FundMe {

    using PriceConverter for uint256; //asi podemos utilizar las funciones del library

/* 
    What is reverting?
    Se deshace cualquier accion de antes (igualar numero a 5 LINEA 32) y se devuelve el gas que no se ha
    utilizado para hacer las acciones que venian despues del require
*/

    uint public minimumUsd = 50 * 1e18;

    address [] public funders;  //array de la gente que está enviando dinero
    mapping(address=>uint256)public addressToAmountFunded; //asociacion de una cartera con el dinero que ha mandado

    function fund()public payable{ 
        /*
            para enviar eth la funcion tiene que ser declarada como payable
            para obtener el valor que se esta enviando 1e18=1eth porq estan en wei
            la palabra require lo convierte en un requisito que se debe cumplir
            si no se cumple, se envia el mensaje y se deshacen la igualacion (the function reverts)
        */

        //number = 5;       //para demostrar que se deshace

        //require(msg.value >= 1e18, "Didnt send enough");    //se esta comprobando en ethereum

        /*
            En la librería la funcion getConversionRate(uint ethAmount) debe recibir un parametro
            Sin embargo en esta implementacion no le hemos pasado nada. Esto es gracias a que coge msg.value
            y lo toma como el primer parámetro de la función. Esto siempre ocurre para cualquiera de las library functions.

            En el caso de que la función fuese getConversionRate(uint ethAmount, uint256 extra)
            Entonces se podría llamar de la siguiente manera:

            msg.value.getConversionRate(123)

            En este caso, el 123 se asignaría al parametro extra
        */

        require(msg.value.getConversionRate() >= minimumUsd, "Didnt send enough");    //se escribe de forma mas simple con la library implementada

        funders.push(msg.sender);                       //almacenar en la lista los addresses que envían fondos

        addressToAmountFunded[msg.sender] += msg.value;  //relacionar el address con la cantidad que se ha enviado
    }

    
    function withdraw()public{
        
        //con este loop reseteamos el mapping
        for(uint256 funderIndex = 0; funderIndex < funders.length; funderIndex++){      
            address funder = funders[funderIndex];                                      //accedemos a la lista de funders
            addressToAmountFunded[funder] = 0;                                          //restablecemos el mapping de la cantidad que ha donado cada cartera
        }

        //resetear el array
        funders = new address [](0);

        /*
            Mandar los fondos de vuelta a los funders (ahora puede ser un poco confuso algunas decisiones de diseño)
            Hay 3 formas distintas de hacerlo:

            1.- TRANSFER:   payable(msg.sender).transfer(address(this).balance);

                Hay que castearlo porque msg.sender es de tipo address pero para poder enviar necesitamos que sea de tipo PAYABLE ADDRESS
                Issues: puede ocurrir un error porque la función de transfer esta capada en 2300 gwei de gas. En caso de que el coste fuese superior
                        a esto, devolvería un error, causando que la función haga un revert (se deshaga el reseteo del array y mapping)


            2.- SEND:       bool sendSuccess = payable(msg.sender).send(address(this).balance);
                            require (sendSuccess, "Send failed!"); 

                Issues: ocurre lo mismo que con la función transfer, esta capado en 2300 gwei de gas. Lo que lo complica es que en vez de devolver un 
                        error y revertir la función, devuelve un boolean si no ha sido capaz de tramitar el pago, por lo que hay que almacenar el resultado
                        del boolean en una variable y meterlo en un require para que almenos se devuelve el coste de gas que hemos dado y no se ha utilizado


            3.- CALL:       (bool callSuccess, bytes memory dataReturned) = payable(msg.sender).call{value: address(this).balance}("");
                            require (sendSuccess, "Send failed!");

                Es una de las primeras funciones low level que hemos utilizado pero es increiblemente potente. 

                WARNING: Normalmente entre los parentensis va el nombre de la función que queremos llamar en otro contrato, pero lo vamos a dejar en vacio con ""

                Por lo tanto, vamos a utlizar call como una transacción al dejar esto vacío y añadir {} y dentro de estos corchetes metemos el valor que queremos
                transferir

                La función call devuelve un booleano de si se ha ejecutado y los datos que se han enviado
                Como bytes es un array habría que utilizar el casting de memory

                Al igual que se ha hecho con latestRoundData que hemos dejado solo la varaible de vuelta que nos interesaba, en este caso
                haremos lo mismo, solo queremos guardar el booleano para verificar que la función se ha llamado y se ha enviado el dinero

                CALL es la mejor forma de enviar y recibir eth a día de hoy
        */

        (bool callSuccess,) = payable(msg.sender).call{value: address(this).balance}("");           //resultado final
        require (callSuccess, "Call failed!");
    }
}

